C# mongodb - how to update nested array elements<p>I have the following JSON structure that represents an item</p>

<pre><code>{
    Id: "a",
    Array1: [{
        Id: "b",
        Array2: [{
            Id: "c",
            Array3: [
                {...}
            ]
        }]
    }]
}
</code></pre>

<p>I need to be able to either replace the array element in <code>Array2</code> with a new item or to replace just <code>Array3</code> with a new array.</p>

<p>Here is my code to replace the array item in <code>Array2</code>:</p>

<pre><code>await Collection.UpdateOneAsync(
    item =&gt; item.Id.Equals("a") &amp;&amp;
    item.Array1.Any(a =&gt; a.Id.Equals("b")) &amp;&amp;
    item.Array1[-1].Array2.Any(b =&gt; b.Id.Equals("c")),
    Builders&lt;Item&gt;.Update.Set(s =&gt; s.Array1[-1].Array2[-1], newArray2Item)
);
</code></pre>

<p>When executing this code I'm getting this error:</p>

<pre><code>"A write operation resulted in an error.
 Too many positional (i.e. '$') elements found in path 'Array1.$.Array2.$'"
</code></pre>

<p>Here is my code to replace <code>Array3</code> within <code>Array2</code>:</p>

<pre><code>await Collection.UpdateOneAsync(
        item =&gt; item.Id.Equals("a") &amp;&amp;
        item.Array1.Any(a =&gt; a.Id.Equals("b")) &amp;&amp;
        item.Array1[-1].Array2.Any(b =&gt; b.Id.Equals("c")),
        Builders&lt;Item&gt;.Update.Set(s =&gt; s.Array1[-1].Array2[-1].Array3, newArray3)
    );
</code></pre>

<p>And this is the error:</p>

<pre><code>"A write operation resulted in an error.
 Too many positional (i.e. '$') elements found in path 'Array1.$.Array2.$.Array3'"
</code></pre>

<p>I'm using C# MongoDB driver version 2.5.0 and MongoDB version 3.6.1</p>

<p>I found this Jira ticket <a href="https://jira.mongodb.org/browse/SERVER-831" rel="nofollow noreferrer">Positional Operator Matching Nested Arrays</a> that says the problem was fixed and they suggested this syntax for the update</p>

<pre><code>Update all matching documents in nested array:

db.coll.update({}, {$set: {“a.$[i].c.$[j].d”: 2}}, {arrayFilters: [{“i.b”: 0}, {“j.d”: 0}]})
Input: {a: [{b: 0, c: [{d: 0}, {d: 1}]}, {b: 1, c: [{d: 0}, {d: 1}]}]}
Output: {a: [{b: 0, c: [{d: 2}, {d: 1}]}, {b: 1, c: [{d: 0}, {d: 1}]}]}
</code></pre>

<p>So I converted it to my elements:</p>

<pre><code>db.getCollection('Items').update(
{"Id": "a"},
{$set: {"Array1.$[i].Array2.$[j].Array3": [newArray3]}}, 
{arrayFilters: 
    [
        {"i.Id": "b"}, 
        {"j.Id": "c"}
    ]}
)
</code></pre>

<p>And got this error:</p>

<pre><code>cannot use the part (Array1 of Array.$[i].Array2.$[j].Array3) to traverse the element
</code></pre>

<p>Any ideas on how to solve this error?</p>

