Which has better performace, fewer DB queries or less code?<p>I am developing a MEAN webapp. I've been two days thinking about which of the following two approaches have better performance.</p>

<p>I currently have a MongoDB database with:</p>

<ul>
<li>Device schema: 1000 devices (documents).</li>
<li>Rental schema: 1700 rentals(documents. Nearly 2 rental average per device).</li>
<li>Reading schema : 1.000.000 readings(documents. 1000 readings aprox. per device).</li>
</ul>

<p>In the dashboard, I need to get all the client active rentals (50-100 rental m.ax per client). then, for each rental I need to get its device by deviceId field for each device its last reading document by deviceId too. </p>

<h2>OPTION1:</h2>

<pre><code>//1. I get the client rentals
    Rental.find({
        start_date: {
            "$lte": new Date()
        },
        end_date: {
            "$gte": new Date()
        },
        clientId : ObjectId(req.params.clientId)
    }, 'deviceId', function(err, Rentals)      {
        if (err) {
            res.send(err)
        } else {

            //2. I create an array with the required deviceIds
            var finalDevices = Rentals.map(function (obj) {
              return obj.deviceId;
            });

            //3. In paralel 
            Async.parallel([
                function(callback) {

                        //3.1 Get devices by the array of deviceIs (only one BD query)
                        Device.find({
                            "_id": { "$in": finalDevices } 
                        },
                        function(err, devices) {
                            if (err) {
                                callback(err, null);
                            } else {
                                callback(null, devices)
                            }
                        }); 

                },
                function(callback) {

                        //3.1 Get last reading for each device (only one BD query)
                        Reading.aggregate([
                            { $match: { "deviceId": { "$in": deviceIds}  } },
                            {
                                $group: {
                                    deviceId: "$deviceId",
                                    maxCreatedAt: { $max: "$createdAt" }
                                }
                            }
                        ],function(err, readings) {
                            if (err) {
                                callback(err, null);
                            } else {
                                callback(null, readings)
                            }
                        })
                }
            ],
            // optional callback
            function(err, results) {
                // create and object matching Rentals array, devices array and readings array by deviceId. Pending. I suppose I'll need to iterate through each array which will be bad performing...
                // [{
                //    rental: ...,
                //    device: ...,
                //    last_reading: ...
                //}]

            });

        }
    });
</code></pre>

<h2>OPTION 2</h2>

<pre><code>var finalData = [];


//1. I get the client rentals
    Rental.find({
        start_date: {
            "$lte": new Date()
        },
        end_date: {
            "$gte": new Date()
        },
        clientId : ObjectId(req.params.clientId)
    }, 'deviceId', function(err, Rentals)      {
        if (err) {
            res.send(err)
        } else {

            Async.each(Rentals, function(rental, callback) {


                    //2. for reach rental we get In paralel (1 BD query per rental) 
                    Async.parallel([
                        function(callback) {

                                //3.1 Get device by the array of deviceIs (1 BD query per each rental)
                                Device.findOne({
                                    "_id": rental.deviceId
                                },
                                function(err, device) {
                                    if (err) {
                                        callback(err, null);
                                    } else {
                                        callback(null, device)
                                    }
                                }); 

                        },
                        function(callback) {

                                //3.1 Get last reading for each device (one BD query per each rental)
                                Reading.aggregate([
                                    { $match: { "deviceId": rental.deviceId  } },
                                    {
                                        $group: {
                                            deviceId: "$deviceId",
                                            maxCreatedAt: { $max: "$createdAt" }
                                        }
                                    }
                                ],function(err, reading) {
                                    if (err) {
                                        callback(err,null);
                                    } else {
                                        callback(null,reading);
                                    }
                                })
                        }
                    ],
                    // optional callback
                    function(err, results) {
                        finalData.push({
                            rental: rental,
                            device: results[0],
                            reading: results[1]
                        });
                    });


            }, function(err) {
                    res.send(finalData);
            });

        }
    });
</code></pre>

<p>In Option1 I only do 3 DB queries but I need to develop a finalcode to match each rental with its device and its last reading.</p>

<p>In option2 I do far more DB queries but I need no extra code to match each rental.</p>

<p>Which option is better? Is there a better approach?</p>

